;;; provided hyperparameters: {:K 5, :mu-0 #vectorz/vector [5.843333326975505,3.0540000025431318,3.758666655222575,1.1986666581034662], :kappa 1.0, :nu 10.0, :lambda-0 #vectorz/matrix [[0.5,0.0,0.0,0.0],
;;; [0.0,0.5,0.0,0.0],
;;; [0.0,0.0,0.5,0.0],
;;; [0.0,0.0,0.0,0.5]], :alpha 0.5}
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/samples</span>","value":"#'gmm-iris/samples"}
;; <=

;; @@
(def sorted-importance-weighted-posterior-samples
  (->> samples
     (take N)
     (collect-by :result)
     (stat/empirical-distribution)
     (#(into (sorted-map-by (fn [key1 key2]
                         (compare [(get % key2) key2]
                                  [(get % key1) key1]))) %))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/sorted-importance-weighted-posterior-samples</span>","value":"#'gmm-iris/sorted-importance-weighted-posterior-samples"}
;; <=

;; **
;;; Let's take a look at a cross-section of the results
;; **

;; @@
(->> (take-nth (/ N 50) sorted-importance-weighted-posterior-samples)
     (into {})
     (map key)
     (map (fn [y] (plot-pca X y #(get colors %)))))
