;; **
;;; # Collapsed Representation
;; **

;; **
;;; We now consider a parametrization in terms of an *inverse-Wishart* prior:
;;; 
;;; $$\boldsymbol{\Sigma}_k \sim \mathrm{inverse\text{-}Wishart}(\mathbf{\Psi}, \nu),$$
;;; $$\boldsymbol{\mu}_k \big|\ \boldsymbol{\Sigma}_k \sim \mathrm{Normal}\hspace{-0.2em}\left(\boldsymbol{\mu}_0, \frac{1}{\lambda} \boldsymbol{\Sigma}_k \right),$$
;;; 
;;; Instead of a *precision matrix* @@\boldsymbol{\Lambda}@@, this model samples a *covariance matrix* @@\boldsymbol{\Sigma} \equiv \boldsymbol{\Lambda}^{-1}@@. We also use the letter @@\lambda@@ instead of the letter @@\beta = \lambda@@, in order to be consistent with the definition of the <a href="https://en.wikipedia.org/wiki/Normal-inverse-Wishart_distribution">Normal-inverse-Wishart distribution</a> in Wikipedia.
;;; 
;;; The prior distributions over hyper-parameters @@\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu@@ in this model are [conjugate](http://en.wikipedia.org/wiki/Conjugate_prior) to the observations @@\mathbf{x}_n@@. This means that the prior distribution @@p(\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu)@@ over hyper-parameters for any cluster @@k@@ is in the same Normal-inverse-Wishart distribution family as the posterior distribution over hyper-parameters @@p(\boldsymbol{\mu}_k{'}, \lambda_k{'}, \mathbf{\Psi}_k{'}, \nu_k{'})@@ for the cluster @@k@@ given emissions @@\\{ x_i \text{ such that } z_i = k \\} @@.
;;; 
;;; Thanks to conjugacy, given the hyper-priors of the Normal-inverse-Wishart distribution @@\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu@@ and the emission values of the Gaussian emission distributions @@\mathbf{x}_i@@, the posterior hyper-priors of the posterior Normal-inverse-Wishart distribution can be calculated <a href="https://en.wikipedia.org/wiki/Conjugate_prior#Continuous_distributions">as follows</a>:
;;; 
;;; $$\boldsymbol{\mu}{'} = \frac{\lambda\boldsymbol\mu_0+n\mathbf{\bar{x}}}{\lambda+n},$$
;;; $$\lambda{'} = \lambda + n,$$
;;; $$\nu{'} = \nu+n,$$
;;; $$\boldsymbol\Psi{'} = \boldsymbol\Psi + \mathbf{C} + \frac{\lambda n}{\lambda+n}(\mathbf{\bar{x}}-\boldsymbol\mu_0)(\mathbf{\bar{x}}-\boldsymbol\mu_0)^T,$$
;;; 
;; **

;; @@
(with-primitive-procedures 
  [div ecount matrix diagonal-matrix to-nested-vectors]

  (defm mvn-mixture 
    [data obs-proc comp-proc]
    (loop [data data
           z []
           obs-procs {}
           comp-proc comp-proc]
      (let [y (first data)]
        (if y
          (let [k (sample (produce comp-proc))
                obs-proc (get obs-procs k obs-proc)
                obs-dist (produce obs-proc)]
            (observe obs-dist y)
            (recur (rest data)
                   (conj z k)
                   (assoc obs-procs
                     k (absorb obs-proc y))
                   (absorb comp-proc k)))
          z))))

  (defquery crp-mvn-mixture
    [data mu kappa nu psi alpha]
    (mvn-mixture data 
                 (mvn-niw mu kappa nu psi) 
                 (CRP alpha)))

  (defquery dir-mvn-mixture
    [data mu kappa nu psi alphas]
    (mvn-mixture data 
                 (mvn-niw mu kappa nu psi) 
                 (dirichlet-discrete alphas))))
