;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/dir-mvn-mixture</span>","value":"#'gmm-iris/dir-mvn-mixture"}
;; <=

;; @@
(def shuffled-X (shuffle (m/to-nested-vectors X)))

(def samples 
  (->> (doquery :smc 
                dir-mvn-mixture
                [shuffled-X
                 (row-mean X) 0.5 10.0 (m/mul (m/identity-matrix 4) 0.5)
                 (into [] (repeat 5 1.0))]
                :number-of-particles 10000)
       (take 1000)
       doall
       time))
